import React from 'react';
import './Song.css';
import ArrowForwardIcon from '@material-ui/icons/ArrowForward';
import Example from './Example'
import { Container, Link, ButtonContainer } from "./SongElements"

function SongPage() {
    return (

        <Container>
            <h3 className="topLevel__Text"> Based on your entry and recent listen history, we recommend these songs:</h3>
            <br /><br />
            <div className="song__Carousel">
                <Example />
            </div>
            <br /><br /><br /><br /><br />
            <ButtonContainer>
                <Link to ="/home" className="next_icon__Link"><ArrowForwardIcon /></Link>
            </ButtonContainer>
        </Container>
    )
}

export default SongPage
